INSERT INTO `overview_details` VALUES (1,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Institute','Vision',NULL,'A front-line institute in science and technology making significant contributions to human resource development envisaging dynamic needs of the society.','2018-2019',NULL),(2,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Institute','Mission',NULL,'To generate experts in science and technology akin to society for its accelerated Socio-economic growth in professional and challenging environment imparting Human values.','2018-2019',NULL),(3,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Department','Vision',NULL,'To become strong centre of excellence for creating competent human resource in the field of Computer Science and Engineering meeting the dynamic societal and industrial needs.','2018-2019',NULL),(4,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Department','Mission','M1','To produce technically competent professionals in Computer Science and Engineering having a blend of theoretical knowledge and practical skills.','2018-2019',NULL),(5,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Department','Mission','M2','To encourage innovation, research, and analytical activities with professional ethics and responsibilities through quality education.','2018-2019',NULL),(6,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Department','Mission','M3','To provide learning ambience in collaboration with industries to keep pace with dynamic technological advancements.','2018-2019',NULL),(7,1,'2019-03-23 17:57:35',NULL,NULL,'Vision and Mission of Department','Mission','M4','To motivate students to apply knowledge to resolve societal and environmental challenges and engage in continuous learning towards sustainable development.','2018-2019',NULL),(8,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 1','Engineering knowledge','Apply knowledge of mathematics and science with fundamentals of Computer Science & Engineering to be able to solve complex engineering problems related to CSE','2018-2019',NULL),(9,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 2','Problem analysis','Identify Formulate review research literature and analyze complex engineering problems related to CSE and reaching substantiated conclusions using first principles of mathematics, natural sciences and engineering sciences.','2018-2019',NULL),(10,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 3','Design/Development  of  solutions','Design  solutions  for   complex engineering problems related to CSE and design system components or processes that meet the specified needs with appropriate consideration for the public health and safety and the cultural societal and environmental considerations.','2018-2019',NULL),(11,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 4','Conduct Investigations of Complex problems','Use researchÃ¢â‚¬â€œbased knowledge and research methods including design of experiments, analysis and interpretation of data, and synthesis of the information to provide valid conclusions.','2018-2019',NULL),(12,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 5','Modern Tool Usage','Create, Select and apply  appropriate techniques, resources and modern engineering and it tools including prediction and modeling to computer science related complex engineering activities with an understanding of the limitations.','2018-2019',NULL),(13,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 6','The engineer and society','Apply Reasoning informed by the contextual knowledge to assess societal, health, safety, legal and cultural issues and the consequent responsibilities relevant to the CSE professional engineering practice.','2018-2019',NULL),(14,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 7','Environment and sustainability','Understand the impact of the CSE professional engineering solutions in societal and environmental contexts and demonstrate the knowledge of, and need for sustainable development.','2018-2019',NULL),(15,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 8','Ethics','Apply ethical principles and commit to professional ethics and responsibilities and norms of the engineering practice.','2018-2019',NULL),(16,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 9','Individual and team work','Function effectively as an individual and as a member or leader in diverse teams and in multi-disciplinary settings.','2018-2019',NULL),(17,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 10','Communication','Communicate effectively on complex engineering activities with the engineering community and with society at large such as able to comprehend and with write effective reports and design documentation, make effective presentations and give and receive clear instructions.','2018-2019',NULL),(18,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 11','Project management and finance','Demonstrate knowledge and understanding of the engineering management principles and apply these to oneÃ¢â‚¬â„¢s own work, as a member and leader in a team, to manage projects and in multi-disciplinary environments.','2018-2019',NULL),(19,1,'2019-03-23 17:57:35',NULL,NULL,'Program Outcomes','PO 12','Life-long learning','Recognize the need for and have the preparation and ability to engage in independent and life-long learning the broadest context of technological change.','2018-2019',NULL),(20,1,'2019-03-23 17:57:35',NULL,NULL,'Program Educational Objectives ','PEO 1',NULL,'To inculcate self-assurance, integrity, technical, collaborative and communication abilities (Leadership) in students, to be able to inspire and guide the team they work in.','2018-2019',NULL),(21,1,'2019-03-23 17:57:35',NULL,NULL,'Program Educational Objectives ','PEO 2',NULL,'To equip students with theoretical knowledge and practical skills to take on the challenges in the industries or research organizations.','2018-2019',NULL),(22,1,'2019-03-23 17:57:35',NULL,NULL,'Program Educational Objectives ','PEO 3',NULL,'To promote among graduates, the quest for lifelong learning to remain professionally more efficient.','2018-2019',NULL),(23,1,'2019-03-23 17:57:35',NULL,NULL,'Program Educational Objectives ','PEO 4',NULL,'To sensitize students towards professional ethics and practices to take up and resolve socially relevant challenges.','2018-2019',NULL),(24,1,'2019-03-23 17:57:35',NULL,NULL,'Program Educational Objectives ','PEO 5',NULL,'To encourage graduates to gain multi-disciplinary knowledge through industrial training and projects leading to innovation, research and sustainable development.','2018-2019',NULL),(25,1,'2019-03-23 17:57:35',NULL,NULL,'Program Specific Outcomes','PSO 1',NULL,'To develop conceptual understanding and application of learned concepts to different domains.','2018-2019',NULL),(26,1,'2019-03-23 17:57:35',NULL,NULL,'Program Specific Outcomes','PSO 2',NULL,'To imbibe professional ethics, communication abilities and quest for continuous learning.','2018-2019',NULL),(27,1,'2019-03-23 17:57:35',NULL,NULL,'Program Specific Outcomes','PSO 3',NULL,'To gain capability to use state of art techniques, skills and tools with mind-set inclined towards innovation and research.','2018-2019',NULL);
