to extract data patterns<br></p>',1,'',1,1.0000000,1.0000000,'truefalse',1,'localhost+210504095227+HxyePv','localhost+210504095228+PEsvcJ',0,1620121947,1620121947,5,5),(17,18,0,'true and false','<p>Storage virtualization is also characteristic of cloud computing<br></p>',1,'',1,2.0000000,1.0000000,'truefalse',1,'localhost+210504150004+Rle0ru','localhost+210504150004+ujxS1F',0,1620140404,1620140404,5,5),(18,20,0,'true and false','<p>Remote Browser access&nbsp;information security technology is used for avoiding browser-based hacking</p>',1,'',1,1.0000000,1.0000000,'truefalse',1,'localhost+210504233333+ZMR6VJ','localhost+210504233334+wk1rdy',0,1620171213,1620171213,6,6),(19,20,0,'short answer','<p>Which practice and precautions taken to protect valuable information from unauthorised access, recording, disclosure or destruction.<br></p>',1,'',1,1.0000000,0.3333333,'shortanswer',1,'localhost+210504233614+Mqbuzp','localhost+210504233614+c92vGa',0,1620171374,1620171374,6,6),(20,22,0,'true and false','<p>A Fuzzy logic is an extension to the Crisp set, which handles the Partial Truth.<br></p>',1,'',1,2.0000000,1.0000000,'truefalse',1,'localhost+210505000301+bm1tM8','localhost+210505000302+KJybss',0,1620172981,1620172981,4,4),(21,22,0,'NAT','<p>How many types of random variables are there in Fuzzy logic?<br></p>',1,'',1,2.0000000,0.3333333,'numerical',1,'localhost+210505000343+kx9SQq','localhost+210505000344+IxCPmn',0,1620173023,1620173023,4,4);
