DROP TABLE IF EXISTS `sem_time_table`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sem_time_table` (
  `id` varchar(128) NOT NULL,
  `subject_code` varchar(12) NOT NULL,
  `lecture_type` varchar(45) NOT NULL,
  `created_by` varchar(128) NOT NULL,
  `created_date` date NOT NULL,
  `session` varchar(45) NOT NULL,
  `year` varchar(45) NOT NULL,
  `semester` varchar(45) NOT NULL,
  `course_id` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `subject_code+lecture_type` (`subject_code`,`lecture_type`),
  KEY `fk_sem_time_table_1_idx` (`subject_code`),
  CONSTRAINT `fk_sem_time_table_1` FOREIGN KEY (`subject_code`) REFERENCES `scheme` (`subject_code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
