INSERT INTO `syllabus` VALUES (1,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34002',NULL,'1.	Introduction: L, G, & AT, Review of Sets, Graphs, Trees, Proof Techniques, Languages and Grammars ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Fundamental Concepts Principal of Maths. Inche, proof by contradiction, etc.\r\n2.	Finite Automata- DFAs, NFAs, Regular Expressions, Regular Grammars and Languages, Properties of Regular Languages, Pumping Lemma for Regular Languages Applications of Regular Expressions .\r\n3.	Pushdown Automata- Context Free Grammar, Parsing, Ambiguity, Nondeterministic PDAs, Normal form of CFGs, CFG to NPDA, NPDA to CFGs. Deterministic PDA, Pumping Lemma for CFGs, Application of CFGs.\r\n4.	Turing Machines ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Turing Machine as acceptor, Recognizing a Language, Universal TMs, Linear Bounded Automata, Context Sensitive Languages, Recursively Enumerable Languages, Unrestricted Grammars.\r\n5.	Chomsky Hierarchy, Concept of Solvability and Unsolvability, ChurchÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s Thesis, Complexity Theory ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ P and NP problems, Introduction to Petri Nets.\r\n','1.	Cohen John, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œIntroduction to Computer TheoryÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Second Edition, Wiley and Sons, 1996.\r\n2.	Hopcroft, Ullman, Motwani, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œIntroduction to Languages, Automata and ComputationÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, 2nd Edition, Pearson Education, 2003.\r\n3.	Peter Linz, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œAn Introduction to Formal Languages and AutomataÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Jones and Bartlett, 2001. \r\n','1.	Lewis and Papadimitiriou, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œElements of Theory of ComputationÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education, 2002.\r\n2.	Mandrioli D. and Gezzi C., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œTheoretical Foundations of Computer ScienceÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Krieger Publishing Co., Inc., USA, 1993.\r\n3.	K.L.P. Mishra and N. Chandrasekaran, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œTheory of ComputationÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Prentice Hall, 1998.\r\nJohn C. Martin, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œIntroduction to Languages and the Theory of ComputationÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Mc Graw Hill, 2010.',NULL,NULL,NULL,NULL),(2,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34005',NULL,'1.	Basic Concepts of Data and Information, Overview of Information Systems, File organization and access methods; Introduction to DBMS, Difference between DBMS and traditional file storage system. Characteristics of DBMS. Data Models, Schemas and Instances,  DBMS architecture, Components of DBMS. Data Independence. Study of Entity Relationship Model, Type of attributes, Entity types, Relationship and Cardinalities, Participation, Roles and constraints.\r\n2.	Relational Data Model: Domains, Tuples, Attributes, Relations, keys and types of keys, Integrity Constraints, Relational Algebra: Queries using Select operation, project operation, renaming, joins, union, intersection, difference, division, and product etc. Relational Calculus, Tuple calculus. Query Language: SQL ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“basic SQL queries, functions, constraints, joins and nested queries, QBE (Query By Example), Indexing, and PL/SQL.\r\n3.	Normalization Theory and Database methodologies: Relation Schemas, Functional Dependencies- Definition and rules of axioms, Normal forms- 1NF, 2NF, 3NF and BCNF, Dependency preservation, properties, loss less join decomposition. Query Processing and Optimization: Various algorithms to implement select, project & join operation of relational algebra, complexity measures.\r\n4.	Transaction Processing: Introduction to Concurrency and Recovery, Read and Write Operations, Transaction properties, Transaction states, Schedules, Serializability, types of serializability and test for serializability, Concurrency Control: Types of Locks, Timestamp Based, Validation Based etc. Multiversion schemes, Recovery: Basic concepts, techniques based on deferred update and immediate update, Shadow paging, check points.\r\n5.	Storage structure: Secondary Storage Devices, RAID, Heap Files and Sorted files, Hashing techniques, Indexing techniques: Bitmap Indices, Case Study of any contemporary DBMS.\r\n','1.	Korth H.F. & Silberschatz A., Sudarshan, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œDatabase SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, McGraw-Hill, Sixth edition, 2010.\r\n2.	Elmasri R., Navathe S.B., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œFundamentals of Database SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, The Benjamin/ Cummings Publishing Company. Inc., 2004.\r\n3.	Date C.J., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œAn Introduction to Database SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Addision Wesley, 8th edition, 2003\r\n','1.	Oracle 9i, The Complete Reference, Oracle Press.\r\n2.	Alexis Leon, Mathews Leon, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œDatabase Management SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Leon Press Chennai and Vikas Publishing House Private Limited, New Delhi, 2002.',NULL,NULL,NULL,NULL),(3,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34007',NULL,'1.	Introduction to computer networks & their uses, Different topologies. ISO-OSI model: Layered Architecture, Peer-to-Peer processes and encapsulation, Function and Services of OSI layers; The Physical layer: Digital Signals, Transmission Impairments and Maximum data rate of a channel, Shennons theorem, Nyquist theorem. Transmission media: Guided and Unguided medias. Circuit, Packet and Message switching, virtual Circuit. Introduction to ISDN & its components.\r\n2.	The data link layer: Design issues & function, Error detection & correction, Forward error correction Versus Retransmission, Hamming code & CRC codes, Framing: Fixed size and Variable size Frame, Bit stuffing and Byte stuffing. Data link layer protocols: Simplest, Stop and Wait, Sliding window protocols, PPP, SLIP, HDLC. The medium access sublayer: Static and Dynamic Channel Allocation, Protocols: ALOHA Protocol, CSMA (CSMA/CD, CSMA/CA), Collision Free Protocol- Bit Map. \r\n3.	IEEE 802 standards for LANs (IEEE 802.3, IEEE 802.4, IEEE 802.5), LAN Devices: HUB, Switches- Learning, Cut-Through and store and forward switches, Bridges: IEEE 802.x to IEEE 802.y, Spanning Tree, Remote Bridge. Internetworking Devices: Routers & gateways. The network layer: Design issues and functions, Internal organization (Virtual Circuit & Datagrams).\r\n4.	Routing algorithms: Shortest path routing, Flooding, LSR, Distance Vector Routing, Hierarchical Routing. Introduction to TCP/IP Protocol stack: Protocol Architecture, Classful IP addressing, ARP, RARP, IP Datagrams with options and its delivery, ICMP.\r\n5.	Subnet, Supernet, CIDR. Transport Layer: Congestion control, Load Shedding, Jitter control, addressing and multiplexing, Connection establishment and connection release, flow control. Application layer: Introduction to DNS and Email.','1.	Tanenbaum A. S., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œComputer NetworksÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education, 4th edition, 2003.\r\n2.	Behrouz A Forouzan, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œData communication and networkingÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, TMH publication, 4th edition, 2006.\r\n3.	Comer, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œInternetworking with TCP/ IP Vol-1ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson education, 4th Edition, 2002.','1.	Peterson & Davie, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œComputer NetworksÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Thomson Learning.\r\n2.	W. Richard Stevens, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œTCP/IP Illustrated Vol-1 ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â Addison-Wesley.\r\n3.	Craig Zacker, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œNetworking The Complete ReferenceÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, TMH, 2001.',NULL,NULL,NULL,NULL),(4,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34008',NULL,'1.	Review of Object Oriented Concepts and Principles: The Object Oriented Paradigm, Basic Concepts, Software Development Life Cycle and Model Architectures.\r\n2.	Introduction to RUP: Basic Concepts, Symptoms in Software Development and their Root Causes, Best Practices of RUP, RUP software life cycle, 4+1 view model, Various Workflows.  \r\n3.	Introduction to UML, Notations, Relationships, Stereotypes, Study of UML based tools Like Rational Rose, Poseidon, etc. Object Oriented Analysis: Conventional v/s OO analysis approach,  Requirement analysis, Use case diagram,,  Activity diagram, Analysis class Model.\r\n4.	Object Oriented Design:  Conventional v/s OO design approach, Design of CRC cards, Class diagram Behavioral Modeling: Interaction Diagram, State chart Diagram, Implementation Diagram: Component and deployment Diagram. Illustrative Case Studies like ATM, Payroll, Course and Registration System.\r\n5.	Object Oriented Testing: Correctness and consistency of OOA & OOD models, Testing Strategies and test cases for OO software process, Project Management, Rational Tool Mentors. Introduction to Design Patterns.','1.	Grady Booch, James Rumbaugh, Ivar Jacobson, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œThe Unified Modelling Language User GuideÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education\r\n2.	Stephen R. Schach, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œObject Oriented Classical Software Engg.ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â  Tata McGraw Hill, 2007.\r\n3.	Gamma G.Helm, Johnson, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œDesign Patterns, Elements of Reusable Object Oriented SoftwareÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Addison Wesley.','1.	Ivon Jacobson, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œObject Oriented Software EngineeringÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Addison Wesley. Booch G., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œThe Unfied Modelling User GuideÃƒÂ¢Ã¢â€šÂ¬Ã‚Â\r\n2.	Phillipe Kruchten, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œThe Rational Unified Process - An IntroductionÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Ed. 2000.\r\n3.	Ivar J, Grady B, James R., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œThe Unified Software Development ProcessÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Ed. 2003.\r\n4.	Timothy C. Lethbridge, Robert Laganiere, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œObject Oriented Software Engg.ÃƒÂ¢Ã¢â€šÂ¬Ã‚Â  ,    Tata McGraw Hill, 2004.\r\n5.	IBM Rational Modules',NULL,NULL,NULL,NULL),(5,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34552',NULL,'1.	Introduction to Operating Systems: Function, Evolution, Different Types, Desirable Characteristics and features of an O/S, Operating Systems Services: Types of Services, Different ways of providing these Services ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Utility Programs, System Calls.\r\n2.	File Systems: File Concept, UserÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s and System ProgrammerÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s view of File System, Disk Organization, Tape Organization, Different Modules of a File System, Disk Space Allocation Methods ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Contiguous, Linked, Indexed. Directory Structures, File Protection, System Calls for File Management, Disk Scheduling Algorithms.\r\n3.	CPU Scheduling : Process Concept, Scheduling Concepts, Types of Schedulers, Process State Diagram, Scheduling Algorithms, Algorithms Evaluation, System calls for Process Management; Multiple Processor Scheduling; Concept of Threads.\r\nMemory Management: Different Memory Management Techniques ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Partitioning, Swapping, Segmentation, Paging, Paged Segmentation, Comparison of these techniques, Techniques for supporting the execution of large programs: Overlay, Dynamic Linking and Loading, Virtual Memory ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Concept, Implementation by Demand Paging etc. \r\n4.	Input / Output : Principles and Programming, Input/Output Problems, Asynchronous Operations, Speed gap Format conversion, I/O Interfaces, Programme Controlled I/O, Interrupt Driven I/O, Concurrent I/O.\r\nConcurrent Processes : Real and Virtual Concurrency, Mutual Exclusion, Synchronization, Inter- Process Communication, Critical Section Problem, Solution to Critical Section Problem : Semaphores ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Binary and Counting Semaphores, WAIT & SIGNAL Operations and their implementation.\r\nDeadlocks: Deadlock Problems, Characterization, Prevention, Avoidance, Recovery. \r\n5.	Introduction to Network, Distributed and Multiprocessor Operating Systems.\r\nCase Studies: Unix/Linux, WINDOWS and other Contemporary Operating Systems.','1.	Silberschatz, Galvin, Gagne, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œOperating System ConceptsÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢, Wiley, 9/E, 2013.\r\n2.	William Stalling, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œOperating SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education, 5/E, 2006.','1.	Andrew S. Tanenbaum, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œModern Operating SystemsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, 3/e, Prentice Hall, 2006.\r\n2.	Maurice J. Bach, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œ The Design of Unix Operating SystemÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Prentice Hall of India, 1999.\r\n3.	Bovet & Cesati, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œUnderstanding the Linux KernelÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, OÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢Reily, 2/E.\r\n4.	Peter Norton, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œComplete Guide to Windows XPÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, SAMS, 2002.',NULL,NULL,NULL,NULL),(6,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34560',NULL,'1.	Introduction to System Programming, Evolution and Components of System Software. C language features for low level programming: Pointer, Memory, inline assembly code Assembler and Disassembler .\r\n2.	Translators and Compilers: Program translation; Introduction to assemblers, review of language grammars and specification of programming languages; Program Compilation, Compilation phases-lexical analysis, parsing and syntax checking, Semantic analysis, Code generation and optimization, machine dependent and independent Compilation; threaded program execution; cross compilers; Issue in compilation of JVM; Object and executable file formats. LEX and YACC.\r\n3.	Interpreters: Virtual machine and program interpretation; Types of interpreters; Target languages for interpretation and Interpreter organization. Cases like JVM ; Just-In-Time compilation.\r\n4.	Linkers and Loaders: Address resolution, linking of subroutines and program relocation; various loading schemes; dynamic linking and DLLs; Object linking and embedding.\r\n5.	Text editors  & Word Processors, Debug monitors, IDE, Device Drivers.','1.	D. M. Dhamdhere, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œSystem Programming and Operating SystemÃƒÂ¢Ã¢â€šÂ¬Ã‚Â Tata McGraw Hill.           \r\n2.	John J. Donovan, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œSystems ProgrammingÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Tata McGraw Hill, New Delhi. ','1.	David Watt and Deryck Brown, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œProgramming Language Processors: Compiler & InterpretersÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Prentice Hall, 2000.\r\n2.	Alfred V. Aho and Jeffrey D.Ullman, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œPrinciple of Compiler DesignÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Narosa Publishing House.',NULL,NULL,NULL,NULL),(7,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34563',NULL,'1.	Review of elementary Data Structures: Stacks, Queues, Lists, Trees, Hash, Graph. Internal representation of Data Structures, Code tuning techniques: Loop Optimization, Data Transfer Optimization, Logic Optimization, etc.\r\n2.	Definitions of complexity, Time and Space Complexity; Time space tradeoff, various bounds on complexity, Asymptotic notation: Big O-notation, Omega-notation, Theta-notation, Recurrences and Recurrences solving techniques: Recursion-tree method and Master method, Average time analysis methods: Probabilistic methods. Amortized analysis.\r\n3.	Design and analysis of algorithms using the brute-force, greedy, dynamic programming, divide-and-conquer and backtracking techniques.\r\n4.	Algorithm for sorting and searching, string matching algorithm, Number-theoretic algorithms, linear programming, Matrix Manipulation algorithms, tree and Graph Algorithms.\r\n5.	NP-hard and NP-complete problems, Approximations Algorithms, Data Stream Algorithms, Introduction to design and complexity of Parallel Algorithms.\r\n','1.	Cormen, Leiserson, Rivest, Stein, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œIntroduction to AlgorithmsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Second Edition, Prentice Hall of India, 2001.\r\n2.	Aho A.V., Hopcroft J.E., J. Ullman, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œDesign and Analysis of Computer AlgorithmsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Addison Wesley, 1998.\r\n3.	Horowitz E. and Sahani, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œFundamentals of Computer AlgorithmsÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Galgotia Publications, 1984.','1.	Knuth D., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œFundamental algorithms: The Art of Computer programmingÃƒÂ¢Ã¢â€šÂ¬Ã‚Â,      Volume ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ I, Third Edition, Pearson Education 1998.\r\n2.	Knuth D., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œSorting and Searching: The Art of Computer programmingÃƒÂ¢Ã¢â€šÂ¬Ã‚Â,          Volume ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ III, Second Edition Pearson Education 1998.\r\n3.	John Kleinberg, Trades E., ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œAlgorithm DesignÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education 2002.\r\n4.	A. Papoulis, S.U. Pillai, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œProbability, Random Variables and Stochastic ProcessesÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, McGraw Hill, Fourth Edition 2006.',NULL,NULL,NULL,NULL),(8,1,'2018-12-06 00:00:00',NULL,NULL,'C1','2017-2018','CO 34565',NULL,'1.	Introduction to the Internet, Overview of TCP/IP protocol suit, Applications of Internet: Email, telnet, FTP etc; Internet Service Providers, IP Addresses, DNS; Evolution of WWW, URL\r\n2. HTTP: Headres, working, methods, MIME type and content encoding, Session              tracking and Cookies; Web Sockets;   HTMLÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“SGML, Basic HTML Elements, Tags and usages, HTML Standards, Issues in HTML, DHTML: Introduction, Cascading Style Sheets. Peer-to-Peer Networking- Concept and details of any one tool such as Napster, BitTorrent, Gnuella etc.; Peer-to-Peer naming- Distributed Hash tables.\r\n3. 	Browser: Working of a Browser, Plug-ins; Study of one browser such as Internet Explorer, Mozilla Firefox etc.; Search Engines- Evolution of search engines, Working of Search Engines; Search strategies, indexing.\r\n4. 	Client Side Programming: Java Applets, Java Script, Javascript Regular expressions, Java script and HTML DOM,  Advanced Javascript and HTML forms,, AJAX etc.\r\nWeb Servers; Server-Side technologies- plug-in; Server Side Programming: CGI, Servlet, JSP, Introduction to J2EE etc.\r\n5.  XML ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“ Basic Standards, Namespaces, DTDS, XML Schema, Linking & Presentation    Standards, Parsing XML, XPath, XML Transformation; Web site planning and design; Application lifecycle; Android based web application.\r\n','1. 	Uttam K. Roy, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œWeb TechnologiesÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Oxford University Press, 2012\r\n2. 	Atul Kahate, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œWeb TechnologiesÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Tata-McGraw Hill, 2013\r\n3. 	Moller,ÃƒÂ¢Ã¢â€šÂ¬Ã‚ÂAn Introduction to XML and Web TechnologiesÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education, 2012\r\n','1. 	Jackson,  ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œWeb TechnologiesÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, Pearson Education, 2012\r\n2. 	Deitel, ÃƒÂ¢Ã¢â€šÂ¬Ã…â€œInternet & World Wide WebÃƒÂ¢Ã¢â€šÂ¬Ã‚Â, 5/e, Pearson Education, 2013\r\n',NULL