INSERT INTO `user_projects` VALUES (1,1,'2019-03-03 02:31:34',NULL,NULL,1,'Departmental Information System (DIS)','The main goal of the DIS is to automate the process carried out in the organization with improved performance and realize the visions of paperless work. We are attempting to improve our existing system that runs on pen and paper. ','Pavitra Malpani','Developer','Dr. Urjita Thakar',NULL,NULL),(2,1,'2019-03-03 02:31:34',NULL,NULL,1,'LEACH Protocol with Enhanced Network Lifetime in Wireless Sensor Network','In this project, a modified algorithm for LEACH protocol is proposed known as Ã¢â‚¬Å“LEACH with Enhanced Network Lifetime protocol (LEACH-ENL) for clustered WSNÃ¢â‚¬Â is aimed at prolonging the lifetime of the sensor networks by balancing the energy consumption of the sensor nodes.','Kanak Soni, Vatika Goswami','Developer','Mr. K. Anil Kumar',NULL,NULL),(4,2,'2019-05-20 02:57:23',2,'2019-05-20 02:58:23',2,'string','string','string','Head','string','1999-02-03','1999-02-03');
